import axios from 'axios';

const EMPLOYEE_API_BASE_URL = 'http://localhost:8080/demo/all';

class ContactService{

    getContacts(){
        return axios.get(EMPLOYEE_API_BASE_URL);
    }
}

export default new ContactService();
